import React from "react";
import { NavLink } from 'react-router-dom';

export class Navbar extends React.Component {
  render() {
    return (
      <nav>
        <ul className="nav-list" className={`${this.props.pathname === '/'
                                ? 'active'
                                : ''}`}>
          <li> <NavLink to='/' exact={true} >Women</NavLink></li>
          <li>men</li>
          <li>kids</li>
        </ul>
      </nav>
    );
  }
}
